import AppLayout from "../component/AppLayout";
import { Input } from "antd";

const Home = () => {
  const onSearch = (value) => console.log(value);
  return (
    <AppLayout version="3.5-turbo">
      <Input.Search
        placeholder="input search text"
        onSearch={onSearch}
        enterButton
      ></Input.Search>
      <div>hello chatGPT</div>
    </AppLayout>
  );
};

export default Home;
